import Binance from '../images/walletx-imgs/binance.jpg';
import walletconnect from '../images/walletx-imgs/walletconnect.png';
import solana from '../images/walletx-imgs/solana.png'; 
import metamask from '../images/walletx-imgs/metamask.jpg'; 

export const wallets = [
	{
		name: 'binance',
		logo: { Binance },
	},
	{
		name: 'walletconnect',
		logo: { walletconnect },
	},
	{
		name: 'solana',
		logo: { solana },
	},
	{
		name: 'solana',
		logo: { solana },
	},
];
